def load_test_set(filename):
	my_file = open(filename, "r")

	header = None
	rownum = 0

	test_set = []
	output = []

	for row in my_file:
		#(emotion, pixel_list, usage)
		splitted = row.split()
		if rownum%2 == 0:
			test_set.append(map(int,splitted))
		else:
			output.append(map(int,splitted))

		rownum += 1

	my_file.close()

	return test_set,output

